window.bookSummaryJSON = "<p>The Excoms specialize in dealing with problems others can’t solve. Kidnappings, human exploitation, oppression. They’ve dealt with them all and earned the gratitude of the overlooked and the disadvantaged.</p> <p>But not everyone is happy with their work.</p> <p>After finishing their most recent assignment, they’re rudely awakened in the middle of the night by an explosive situation that changed the team forever.</p> <p>Some may think Ananke and her friends are no longer a threat. Some would be making a mistake.</p> <p>You may knock The Excoms down, but you can never count them out.</p> <p><b>If you enjoy action-packed espionage crime thrillers with high-stakes suspense, surprising plot twists, and a cast full of unforgettable characters, then join millions of fans who love Battles’ novels and start your next great listen, </b><b><i>Blinded by the Night</i></b><b>, today.</b></p>"; 
